INSERT INTO `fest_detail` (`fest_id`, `state_id`, `fest_name`, `fest_descript`, `fest_img`) VALUES
(1, 12, 'Diwali ', 'In India the fair of Diwali is measured as the leader festival. In Gujarat the Diwali fiesta is connected with the adoration of the "Goddess of Wealth`, Mother Lakshmi. The populaces of this state are of solid conviction that Goddess Lakshmi will come out on this day to sanctify the earth with achievement and good luck.\r\n', 'p8.jpg'),
(2, 1, 'Kite Festival', 'This is considered as a countrywide festival in the state of Gujarat and is experiential on the 14th of January. Exactly on the day when the Sun goes into the tropic of cancer this Kite festival is distinguished with glory. On this very day the adolescence as well as the full-fledged is on the pinnacle of their individual homes and soar kites. Both the male and female associates of the family decorate themselves in bright outfits and treat themselves in the conventional dance known as `Dandiya`. Extravagant Gujarati flimsiness is also equipped to rejoice this festival.', '20071021dasara61.jpg'),
(3, 1, 'Holi', 'The spring festival of Holi is distinguished in Gujarat in the month of Phalgun or in the months of February and March. The event of Holi is distinguished with colors and people of this state resound with the tunes of the folk-song, "Govinda ala re, zara matki sambhal Brijbala". Fun and gambol is also redefined in diverse forms in the cheerful celebrations here. People welcome each other with colors and thus improve the emotion of harmony. The illumination of beacon also forms a particular trait in the Holi festival when renowned in Gujarat.', '2.jpeg/3D-happy-holi-image-wallpaper.jpg/800x533xHappy-Holi-HD-Wallpaper-Desktop.jpg.pagespeed.ic.EYWkTCC7Ya.jpg/Happy-Holi-hd-wallpapers.jpg/Holi-celebrations-Group-of-kids-playing-Holi-in-India.jpg/Radha Krishna Holi HD Wallpaper.jpg/xHoli-Colorful-HD-Wallpaper-Download-1024x640.jpg.pagespeed.ic.EEn5qN0Zgc.jpg'),
(4, 1, 'Janmashtami', 'Janmashtami is recognized for the delivery centenary of Lord Krishna. It is renowned in the state of Gujarat along with in India with huge passion. It is prearranged in this state in the month of July and August as per the English calendar. On this day the Hindu people of Gujarat keeps daylong fasts and also keeps themselves stirring while chanting tones and verses in the respect of the noble till midnight. The statue of Lord Krishna is suffused and then placed on a swing. Rasila is executed to reconstruct incidents from the existence of the noble and to commemorate his adore for his beloved, Radha.', '2283_janmashtami-wallpaper-23.jpg/e386da1c8705babe71f38db8b69a8871.jpg/happy-janmashtami-widescreen--wide-hd-wallpapers.jpg/Happy-Shri-Krishna-Janmashtami-HD-Images-Wallpapers-Free-Download-7.jpg/krishna-janmashtami-wishes-celebration--wide-hd-wallpapers.jpg'),
(5, 1, 'Ganesh Chaturthi', 'In Gujarat this Ganesh Chaturthi is one of the most well-liked festivals. It is celebrated in honor of Lord Ganesh who is supposed to be the eliminator of all obstacles. This fiesta is celebrated with imposing processions that are carried out by moving huge idols of Lord Ganesh. These idols are festooned in bright outfits and overstated with valuable jewels.', '1653_lord-ganesha-wallpaper-09.jpg/Ganapati1.jpg/Ganesha-Chaturthi-Greetings-Cards-HD-Desktop-Wallpapers (1).jpg/Ganesh-Chaturthi-HD-Images-Wallpapers-Free-Download-3.jpg/Ganesh-Chaturthi-HD-Images-Wallpapers-Free-Download-7.jpg/ganesh-chaturthi-wallpapers-wishes.jpg'),
(6, 1, 'Muharram', 'This is the most admired Muslim fiesta celebrated in the state of Gujarat with much passion. The major underline of this festival is the Tazia parade that has been in the city of Ahmedabad of Gujarat for centuries. It also includes acrobats, drummers and singers processions. The momentous implication of this festival lies in the fact that the Mughal sovereign Jahangir and his beloved wife Noor Jahan often watched it from the `teen darwaza` or triple arches. This fiesta also reflects the accurate worldly strength of the state.', 'beautiful_top_hd_muharram_photo-800x600.jpg/Latest-Muharram-Wallpaper-for-Mobile.jpg/Muharram-Ul-Haram-HD-images.jpg/Muharram-ul-haram-HD-Wallpaper.jpg/Muharram-ul-Haram-HD-Wallpapers.jpg'),
(7, 1, 'Kutch Mahotsava', 'The tourism authorities of Gujarat systematize this fiesta every year in the month of February according to the English calendar. This accepted festival not only illustrates folk dancing, music, poetry, ballads, local handicrafts and jewelry but also brings the citizens from all over the state to tender a whole fresh articulation to the term "Communal Harmony".', '2012_bhuj_day1_eve_34.jpg/292154.jpg/Ganga-Mahotsav.jpg/Kutch-Mahotsava.jpg/Wishing-You-A-Very-Happy-Kutch-Mahotsav.jpg'),
(8, 1, 'Navratri', 'Gujarat is Navratri Festival, is a circle of ecstasy that throbs non-stop for nine nights with millions of fantastically costumed devotees swaying in a fusion of dance and devotion. Although this festival is celebrated throughout India, nowhere is it performed with more panache and fervor than in Gujarat.  The significance of Navratri is offering devotion to Goddess Amba (Durga), who is believed to exist in many forms. These Goddesses are believed to be known as Shakti as the tales narrate their power over killing of demons. Parvati, the wife of Shiva is said to have taken different forms of goddesses. Devotees perform the devi-sthaapna in their homes wherein they invite the Goddess and perform pooja-path for nine days with fasting. ', '48-2.jpg/Happy-Navratri-Durga-Maa-Mata-Devi-Images-Photo-Dp-HD-Wallpapers-1.png/Happy-Navratri-HD-Wallpapers-Free-Download.jpg/Nav-Durga-hd-mobile-wallpaper-1280x1024.jpg/Navratri-Images-Wallpapers.jpg/Navratri-Wallpapers.jpg'),
(9, 2, 'Onam', 'Celebrated in Kerala, Onam is known for being a harvest and secular festival. People from different castes, religions and creeds come together to celebrate Onam. It is assumed that the mythical King Mahabali comes every year to have a look over his subjects during this period. The traditional danceThiruvathira kali or Kaikotti kali is also performed during Onam. It is also known as the Festival of Rain Flowers. The first and last day of this ten day festival are the main days. Pookkalam, a multi-coloured decoration is painted by the people, in front of their homes during this festival.', 'Happy-Onam-2.jpg/happy-onam-2016-image.jpg/onam hd wallpapers 00-008.jpg/Onam-2013-Festival-of-Kerala.jpg/onam-wishes1.jpg'),
(10, 2, 'Pongal', 'It is celebrated on 14th January in Tamil Nadu. The word Pongal is Tamil language basically signifies the meaning to boil over. In Tamil Culture, the milk boiling from the clay pot means prosperity in the household. In this festival, it is considered auspicious to offer boiled rice in milk to the Sun God. Food items made with sugar cane are served during this festival. Though, in the cities, it is only celebrated for one day, it normally is a four day long festival, consisting of these days- Bogi, Pongal, Mattu Pongal and Kanum Pongal.', '2634_happy-pongal-hd-wallpaper.jpg/HappyBPongalBhdBWallpaperB2015.jpg/Happy-Pongal-2016-6.jpg/Happy-Pongal-Wallpapers-Pictures-Images-Photos-Wishes.jpg'),
(11, 2, 'Hampi Festival', 'Also known as the Vijaya Utsav, the Hampi Festival is one of the largest festivals in Hampi. Celebrated in the first week of November, it includes events such as dance puppet shows, fireworks, music shows, pomp possessions, water sports and rock climbing. This festival is propagated by the Government of Karnataka.', '2prs4dk02iia.jpg/25-hampi-festival-130114.jpg/Hampi-festival-2016.jpg/hampi-festival-karnataka3.jpg/Hampi-Utsav1.jpg/hampi-utsav-1.jpg'),
(12, 2, 'Mysore Dasara', 'It is also known as the state festival of Karnataka. Summoned as Navratri in Northern India, this ten day festival starts from the day of Vijayadashami. It is celebrated in the months of September and October. According to Hindu mythology, it is believed that the Hindu Goddess Chamundeshwari killed the demon Mahishasura. This festival is celebrated in Karnataka from the very 15th century. More than 1 lakh light bulbs adorn the Mysore Palace during these ten days.', '10sept06kpn933.jpg/20071021dasara61.jpg/festival-dasara-procession-before.jpg/mysore-dasara-2015 (1).jpg/Mysore-Dasara-2015.jpg'),
(13, 2, 'Karaga', 'Known as one of the oldest festivals of Karnataka, Karaga is one of the lauded festivals of theThigala community in Karnataka. Hindu mythology reveals the that in the end of Mahabharata, it was Draupadi which protected the lives of Pandavas. Thus, it is believed that during the festivity of Karaga, the power of Draupadi can be felt in the ambience. It is a nine day long festival and generally takes place in the month of March and April.', 'hqdefault.jpg/karaga-bangalore-k3.jpg/maxresdefault.jpg/pxzbcjtz.jpeg'),
(14, 2, 'Ugadi', 'The term Ugadi means the beginning of the new Age. It is celebrated to mark the beginning of the Hindu lunar calender. Numerous traditional dishes are also cooked during this festival, like the delicious chutney called as Ugadi Pachadi. In different parts of India, Ugadi is called by different names, for example, it is called as Baisakhi in Punjab and Gudi Padwa in Maharashtra and nutan varshabhi nandan (new year) in gujarat.', 'Gudi-Padwa-Wishes-in-hindi1.jpg/Happy-Baisakhi15.jpg/Happy-Gudi-Padwa-2015-compressor.jpg/Indian-punjabi-festival-Baisakhi-hd-wallpapers.jpg/ugadi-festival-wishes-wallpaper.jpg/Ugadi-Greetings-in-Telugu-green-color.jpg'),
(15, 2, 'Vishu', 'It is celebrated as the New year in Kerala in the month of April. Vishupadakkam or bursting of crackers and decoration with lights is one of the prime attractions of the festival. Vishukkaineetam is the tradition of giving money during this festival. Vishukkani is the first thing to be seen after getting up on the day of Vishu. It basically consists of fruits, rice, metal mirror, betel leaves, yellow flowers, coins etc.', 'Happy-Vishu-Baal-Krishan-Wallpaper.jpg/Happy-Vishu-Festival-2013-HD-Wallpaper.jpg/Happy-vishu-special-hd-Greetings.jpg/vishu-special-hd-Greeting.jpg'),
(16, 2, 'Thrissur Pooram', 'Lauded as one of the important temple festivals in Kerala, Thrissur Pooram is heald atVadakkunnathan Temple in Thrissur. It is a secular festival and thus, religious considerations are not important for the celebration of this festival. The Maharaja of Cochin, known as Raja Rama Verma started this custom of Thrissur Pooram in 1798. As per the Malayalam Calender, it is celebrated every year in the month of April.', 'thrisoor-Pooram-NISHAM-ABDULMANAF1.jpg/Thrissur Pooram Kerala Festival Photos - 4.jpg/Thrissur_pooram_one_of_a_kind_51.jpg/thrissur-pooram-1.jpg'),
(17, 2, 'Chithirai Thiruvizha', 'This festival is celebrated in the Chitirai Month of the Tamil Calender which falls in the month of April. It is a one month long festival, in which the first fifteen days are meant for worshipping Meenkashi, the reincarnation of Goddess Parvati. The last fifteen days are celebrated for the Alagar, who is a reincarnation of Lord Vishnu.', 'alagar06.jpg/kallalagar.jpg/maxresdefault (1).jpg/maxresdefault.jpg'),
(18, 2, 'Mahamaham Festival', 'After every 12 years, this festival is celebrated in the Kumbakonam town in Tamil Nadu. It is considered auspicious to take a holy dip in the Mahamaham tank during this day. It is celebrated when the planet Jupiter enters the Leo sign. "Theerthavari" is the custom of all the deities from the temples in the  Kumbakonam town having a bathe in the tank along with the devotees. It is considered as a purification bath.', '02.jpg/03.jpg/dc-Cover-152s3aqdm3h3ldsgkjsaer78p1-20160221055819.Medi.jpeg/decorated-urchava-deities-in-mahamakham-mahamaham-festival-kumbakonam-et0cr4.jpg/DSC03031.jpg'),
(21, 11, 'mmm', 'rrr', 'm.jpg/n.jpg');
