(14, 2, 'Party Glitter Powder', 'holi.jpg', 'Glitter powder is a shimmery coloured party powder. Made from corn starch. Our offered glitter powder is very safe for skin and hair. Use these colours in party and event to add fun and glamour to your party.  Throw them on each other and have a glossy look in a fun way.\r\nSPECIFICATION.\r\nThe manufacturing company from Uttar Pradesh, India supplies glitter powder in pouches of different sizes. For greater quantity orders, we pack these glitter holi powder in gunny bags and plastic buckets. As the name implies, the party glitter power can be used in parties and events to bring glamour. This party glitter powder is available in silver and golden colors. This can also be used for decoration, crafts work and gifts. This powder can also be used in Holi festival for playing. People apart from using old school colors on each other, are preferring this glitter holi powder. This glittering and shiny powder is dry, that can be applied on skin or thrown in the air. The special features of thus glitter holi powder are:.\r\n	These are non-toxic.\r\n	These are skin friendly.\r\n	These are resistant to heat.\r\n	These are Eco-friendly.\r\n	These can be removed easily.\r\nFEATURES:.\r\n	Non toxic.\r\n	EN-71 certified.\r\n	Safe for skin and hairs.\r\n	Easy to remove.\r\n	5. Available in 2 shades: Silver and golden.\r\nPACKAGING AVAILABLE:.\r\n	Plain pouches: 25gm, 50gm, 75gm, 100gm.\r\n	Plastic Buckets.\r\n	Gunny bags: 5kg, 10kg, 25kg.\r\n	Customised packing for bulk orders\r\n', 150, 0, 25),
