(21, 4, 'Lord Krishna Costumes Fancy Dress Birthday bday gift Janmashtami Festival', 'krishna_.jpg', 'Product Information.\r\nTechnical Details.\r\nColor:Lemon & Red.\r\nItem part number:NS-KR-19.\r\nManufacturer Minimum Suggested Age (years):3.\r\nProduct Description.\r\n1: Krishna costume is very popular for kids Fancy Dress competition. 2: We offer Krishna Costumes with Accessories like Necklace, Kundal, Decorated Flutes and Crowns available for your children. 3: Costumes has been described in the Hindu scriptures and reveals. 4. Outfits for Krishna available in many sizes And colors. S 3 - 4 Years M 5 - 7 Years L 8 - 10 Years\r\n\r\n', 440, 0, 20),
(22, 4, 'Krishna Decorative Statue with frame in Brass with Antique Finish', 'watermarking-product.jpg', 'Size: 22.00 X 12.00 X 36.00 cms.\r\nBrand: Aakrati.\r\nA wide range of Exclusive decorative, religious, showpiece , table decor and wall hanging metal statue, brass ware, Statue, Gift and craft, Candle stand, bells, figure and Sculpture. We are manufacture of metal handmade handicrafts and craft in different sizes and finish. We do bronze, silver, nickel, gold, antique, patina and lacquer finish on our products. Our products can be used at home, office, resorts, hotel, garden and Public area also. All of our products can use for decoration, gift and co gifting. We also deal Swing chain set for outdoor and indoor purpose. We also carry a wide range of rare door Hardware fitting as door handle, door knocker, knob, hooks, door lock and pad locks etc. We can make customise Statue and sculpture as per requirement\r\n', 7200, 0, 15),
(23, 4, 'Beautiful and Attractive Baby Krishna Statue Eating Butter', 'watermarking-product (1).jpg/watermarking-product (2).jpg/watermarking-product (3).jpg', 'Size: 12,70 X 12,70 X 21,59 cms.\r\nBrand: Aakrati.\r\nThis extraordinary decorative statue is just one of the many pieces of art available from the designers. These talented craftsmen employ a variety of mediums such as metal to create truly unique modern objects, perfect for the high end contemporary home or office. Brass statue is polished with environment friendly Color to match your decor, for better maintainability and longevity of the shine of the product\r\n', 2657, 0, 24),
(24, 4, 'Ladoo Gopal Sitting on a Throne', 'watermarking-product (4).jpg/watermarking-product (5).jpg', 'Size: 8,89 X 8,89 X 13,97 cms.\r\nBrand: AMLIK.\r\nA Brand New Metal Zinch made gold plated Religious Idol for your home, office docor also for Temple. Unique for gifting. Invite peace prosperity and wealth into your home & office when you have this rare idol with you. This figure is constructed from zinc ensures good strength and durability. It has good handmade item', 389, 0, 19),
(25, 4, 'Handicrafted Statue of Lord Krishna in Antique Finish', 'watermarking-product (6).jpg/watermarking-product (7).jpg/watermarking-product (8).jpg', 'Size: 53,34 X 40,64 X 68,58 cms.\r\nBrand: Aakrati.\r\nInvite peace, prosperity and wealth into your home when you have this statue with you. This statue is constructed form brass, which ensures good strength and durability. It has a smooth and detailed texture. Make this one yours today. Size :- 21(L) x 16(B) x 27(H) (inch)', 41600, 0, 30),
(26, 5, 'Picturesque Ganesha : Ganesha Hangings', 'tokenz-aaprds25b.jpg/tokenz-aaprdS25Ba.jpg', 'Product Details.\r\nCreate a holy and pious environment in your home this diwali by bringing this pretty artistic showpiece home. The marvellous Ganesha idol at the center makes you feel the divine presence of Lord of Wisdom. The perfect color combination- brown background with black handle and green bottom increase the beauty of the product. The base is made up of clay and is decorated all around with golden bead like structures. However the Ganesha idol is made up of fiber and therefore offers the best quality.\r\n	Size:\r\n4 inches x 3 inches.\r\n	Weight:\r\n200 Gms.\r\n	Color/Material:\r\nMulticolored / Idol : Fiber, Base : Painted Earthen Clay\r\n', 200, 0, 20),
(27, 5, 'Ucchista Ganapati : White Metal Wall Hanging', 'white metal.jpg', 'Product Details.Portrayed in this spectacular white metal wall hanging is Lord Ganesha inaugurating the beginning of all auspicious occasions by the blessing tune of the sitar. Make this spectacular art piece your possession and bring to the decor, a blissful charm reflected by every carved body part of the Lord.\r\n  Height- 8 inches.\r\n	Size:\r\n8 inches.\r\n	Weight:\r\n600 gm.\r\n	Color/Material:\r\nSilver / Oxidized White Metal\r\n', 195, 0, 13),
(28, 5, 'Ganesha Painting Puja Kit', 'paint.jpg/painting.jpg', 'Product Details.It is always good to gift auspicious gift items as worship of god is an important part of every occasion or celebration. Make your dear ones feel elated with this very fabulous gift combo. This gift combo is comprises of one designer box, silver plated roli chawal container, diya, small Bhagwat Geeta, tulsi mala, 108 manka mala, moli and agarbatti. The designer box is very beautifully adorned with semi precious gem stones. Painting of lord ganesha on the cap of this box makes it look more beautiful. This gift combo is perfect for gifting on any special occasion. So go ahead, place your order now. Product Details: Puja kit- box designed with semi precious gem stones ganesha painting with silver plated roli chawal container, diya, small Bhagwat Geeta, tulsi mala and 108 manka mala, moli, agarbatti.\r\n	Weight:\r\n600 gm.\r\n	Color/Material:\r\nblack,silver / wooden-box, silverplated-roli chawal container\r\n', 900, 0, 20),
