(34, 10, 'HP 22es Display 54.6 cm, 21.5 Inch THINNEST IPS LED Backlit Monitor', '61lweAaBPPL._SL1200_.jpg/81AZ4EZJG1L._SL1200_ (1).jpg/81AZ4EZJG1L._SL1200_.jpg/91IGjVO1lyL._SL1500_.jpg/511O-4j8jqL._SL1200_.jpg', '22,5 Inch Full HD IPS LED Monitor.\r\nProduct Information.\r\nTechnical Details.\r\nBrand:	HP.\r\nColour:	Natural Silver (Front and Stand) and Black (Rear).\r\nItem Height:	38,5 Centimeters.\r\nItem Width:	49,8 Centimeters.\r\nScreen Size:	21,50 Centimeters.\r\nScreen Resolution:	1920 x 1080 @ 60 Hz.\r\nMaximum Display Resolution:	1080p Full HD.\r\nItem Weight:	4,2 Kg.\r\nProduct Dimensions:	18,4 x 49,8 x 38,5 cm.\r\nItem model number:	22es.\r\nWattage:	18 Watts.\r\nPower Source:	AC.\r\nIncluded Components:	A/C power cable 1:9 m, Power adapter 1:0 m, CD, Quick Setup Poster.\r\n 	 \r\nAdditional Information.\r\nASIN:	B01F8LCALM.\r\n 	 \r\nWarranty & Support.\r\nWarranty, Parts: 1 Year Manufacturer Warranty.\r\n\r\nWarranty Details: 1 Year Manufacturer Warranty', 13999, 0, 20),
(35, 10, 'Engage Combo Pack Deo Sprays, with Free Tempt Deo Spray', '71dhpqqUFaL._SX522_.jpg', 'Product details.\r\nItem part number: ZepItc0090.\r\nASIN: B01LY4SQNA.\r\nDate first available at Amazon.in: 12 September 2016.\r\nAverage Customer Review: 4 out of 5 stars  See all reviews (2 customer reviews).\r\nAmazon Bestsellers Rank: #89 in Beauty (See Top 100 in Beauty).\r\n#8 in Beauty > Bath & Shower > Deodorants & Antiperspirants.\r\n#9 in Beauty > Fragrance.\r\n#34 in Beauty > Skin Care > Body.\r\nProduct Description.\r\nEngage presents a classic combination of three fragrances. Engage Abandon is a fragrance that is urban, mischievous and young with a fresh fruity and effervescent fragrance. It connotes the contemporary young urban woman with a sunny, joyous and infectious cheerfulness. Engage drizzle is a rich lavender fragrance for a modern woman. Its fresh aromatic top notes bring memories of the luxury and comfort reminiscent of a spa, ?making a strong statement for the contemporary woman. Engage Tempt is a sophisticated fragrance with a refreshing edge. It is a real delight for senses, with a colorful blend of fruitiness and floralcy sophisticated by woody and ambery accents giving it a refreshing scent. It exudes the persona of an extrovert with a zest for the unexpected', 399, 0, 20),
